             ['Injury',
              u'\u2022F\xf6rl\xe4ngd neuromuskul\xe4r blockad* *Ytterligare information om o\xf6nskade reaktioner: Anafylaktisk reaktion Allvarliga anafylaktiska reaktioner vid anv\xe4ndning av neuromuskul\xe4rt blockerande medel har rapporterats vara fatala i vissa fall. P\xe5 grund av risken f\xf6r s\xe5dana sv\xe5ra reaktioner b\xf6r man alltid f\xf6ruts\xe4tta att de kan intr\xe4ffa och d\xe4rf\xf6r vidta n\xf6dv\xe4ndiga f\xf6rsiktighets\xe5tg\xe4rder. Lokala reaktioner vid injektionsst\xe4llet Vid snabbinduktionsanestesi har sm\xe4rta vid injektion rapporterats, s\xe4rskilt hos patienter som \xe4nnu inte har f\xf6rlorat medvetandet helt och s\xe4rskilt n\xe4r propofol anv\xe4nds som induktionsmedel. I kliniska studier har sm\xe4rta vid injektionsst\xe4llet observerats hos 16 % av de patienter som genomgick snabbinduktionsanestesi med propofol och hos mindre \xe4n 0,5 % av de patienter som genomgick snabbinduktionsanestesi med fentanyl och tiopental. F\xf6rh\xf6jda histaminniv\xe5er Eftersom neuromuskul\xe4rt blockerande substanser \xe4r k\xe4nda f\xf6r att kunna inducera histaminfris\xe4ttning b\xe5de lokalt och systemiskt skall risken f\xf6r utveckling av kl\xe5da och erytemat\xf6sa reaktioner p\xe5 injektionsst\xe4llet och/eller generaliserade histaminliknande (anafylaktoida) reaktioner s\xe5som bronkialspasm och kardiovaskul\xe4ra f\xf6r\xe4ndringar, t.ex. hypotension och takykardi, alltid beaktas n\xe4r dessa l\xe4kemedel ges. Hudutslag, exantem, urtikaria, bronkospasm och hypotension har rapporterats i'],
